        <h2 className="text-xl">Men's Shoes ()</h2>
        <div className="mt-4 *:inline-block">
          <div className="w-2/12">
            <Filter />
          </div>
          <div className="w-4/6 mx-9">Products</div>
        </div>
      </div>
    </Layout>
  );
}

export default Men;
